const canvas = document.getElementById("canvas");
const ctx = canvas.getContext("2d");
const img = new Image();
img.src = "data:image/png;base64,";

let code = '';

const formElement = document.getElementById('form');
formElement.addEventListener('submit', function(e) {
  e.preventDefault();
  if (code == '4242') {
    window.ReactNativeWebView.postMessage("ExitGame")
  } else {
    alert(`Congrats ${code}! You were successfully added to the list of Winners`);
  }
})

const codeElement = document.getElementById('code');
codeElement.addEventListener('change', (event) => {
  code = event.target.value;
});

try {
  let gamePlaying = false;
  const gravity = 0.5;
  let speed = 8;
  let loading = false;
  const size = [51, 36];
  const jump = -11.5;
  const cTenth = canvas.width / 10;

  let index = 0,
    bestScore = 101,
    havePlayedOnce = false,
    flight,
    flyHeight,
    currentScore,
    pipes;

  const pipeWidth = 78;
  const pipeGap = 270;
  const pipeLoc = () =>
    Math.random() * (canvas.height - (pipeGap + pipeWidth) - pipeWidth) +
    pipeWidth;

  const setup = () => {
    currentScore = 0;
    flight = jump;

    flyHeight = canvas.height / 2 - size[1] / 2;

    pipes = Array(3)
      .fill()
      .map((a, i) => [canvas.width + i * (pipeGap + pipeWidth), pipeLoc()]);
  };

  const render = () => {
    index++;

    ctx.drawImage(
      img,
      0,
      0,
      canvas.width,
      canvas.height,
      -((index * (speed / 2)) % canvas.width) + canvas.width,
      0,
      canvas.width,
      canvas.height
    );
    ctx.drawImage(
      img,
      0,
      0,
      canvas.width,
      canvas.height,
      -(index * (speed / 2)) % canvas.width,
      0,
      canvas.width,
      canvas.height
    );

    if (gamePlaying) {
      pipes.map(pipe => {
        pipe[0] -= speed;

        ctx.drawImage(
          img,
          432,
          588 - pipe[1],
          pipeWidth,
          pipe[1],
          pipe[0],
          0,
          pipeWidth,
          pipe[1]
        );
        ctx.drawImage(
          img,
          432 + pipeWidth,
          108,
          pipeWidth,
          canvas.height - pipe[1] + pipeGap,
          pipe[0],
          pipe[1] + pipeGap,
          pipeWidth,
          canvas.height - pipe[1] + pipeGap
        );

        if (pipe[0] <= -pipeWidth) {
          currentScore++;

          if (currentScore % 5 === 0) {
            speed += 1;
          }
          bestScore = Math.max(bestScore, currentScore);
          pipes = [
            ...pipes.slice(1),
            [pipes[pipes.length - 1][0] + pipeGap + pipeWidth, pipeLoc()],
          ];
        }

        if (
          [
            pipe[0] <= cTenth + size[0],
            pipe[0] + pipeWidth >= cTenth,
            pipe[1] > flyHeight || pipe[1] + pipeGap < flyHeight + size[1],
          ].every(elem => elem)
        ) {
          gamePlaying = false;
          loading = true;
          setTimeout(() => (loading = false), 1000);
          setup();
        }
      });
    }
    if (gamePlaying) {
      ctx.drawImage(
        img,
        432,
        Math.floor((index % 9) / 3) * size[1],
        ...size,
        cTenth,
        flyHeight,
        ...size
      );
      flight += gravity;
      flyHeight = Math.min(flyHeight + flight, canvas.height - size[1]);
    } else {
      ctx.drawImage(
        img,
        432,
        Math.floor((index % 9) / 3) * size[1],
        ...size,
        canvas.width / 2 - size[0] / 2,
        flyHeight,
        ...size
      );
      flyHeight = canvas.height / 2 - size[1] / 2;
      ctx.fillText(`Best score : ${bestScore}`, 85, 245);
      ctx.font = "bold 25px courier";

      if (havePlayedOnce) {
        formElement.style.display = 'block';
      } else {
        ctx.fillText("Tap to play", 120, 535);
      }
    }

    document.getElementById("bestScore").innerHTML = `Best : ${bestScore}`;
    document.getElementById(
      "currentScore"
    ).innerHTML = `Current : ${currentScore}`;

    window.requestAnimationFrame(render);
  };

  setup();
  img.onload = render;

  document.getElementById('canvas').addEventListener("click", () => {
    formElement.style.display = 'none';
    havePlayedOnce = true
    if (!gamePlaying && !loading) {
      speed = 4.2;
      gamePlaying = true;
    } else {
      flight = jump;
    }
  });
} catch(err) {
  alert('ERROR')
  alert(err.message);
}
